// This is a sample mapping. You should replace these URLs with actual team logo URLs
export const teamLogoUrls = {
  "Bayern Munich": "https://example.com/bayern.png",
  "Borussia Dortmund": "https://example.com/dortmund.png",
  // Add more teams...
};

// Fallback logo if team logo is not found
export const defaultLogoUrl = "https://example.com/default-team.png";

export const getTeamLogoUrl = (teamName) => {
  return teamLogoUrls[teamName] || defaultLogoUrl;
};
